import recipedata from './recipe.json';

function IngredientList() {
   return (
    <div>
      <h3>Ingredients</h3>
      {recipedata.map((data) => {
        return (
          <div key={data.name}>
            {data.ingredients.map((ingredient, index) => {
              return <li key={index}>{ingredient}</li>;
            })}
            </div>
        );
      })}
    </div>
   );
 }
 
 export default IngredientList;
 
